query EventHistoryPollQuery(
  $archetype: ArchetypeInputType
  $categories: [CollectionSlug!]
  $chains: [ChainScalar!]
  $collections: [CollectionSlug!]
  $count: Int = 10
  $cursor: String
  $eventTimestamp_Gt: DateTime
  $eventTypes: [EventType!]
  $identity: IdentityInputType
  $showAll: Boolean = false
  $stringTraits: [TraitInputType!]
  $isRarityExpansionEnabled: Boolean!
  $rarityFilter: RarityFilterType
) {
  eventActivity(after: $cursor, archetype: $archetype, categories: $categories, chains: $chains, collections: $collections, eventTimestamp_Gt: $eventTimestamp_Gt, eventTypes: $eventTypes, first: $count, identity: $identity, includeHidden: true, stringTraits: $stringTraits, rarityFilter: $rarityFilter) {
    edges {
      node {
        collection {
          ...CollectionCell_collection
          id
        }
        traitCriteria {
          ...CollectionCell_trait
          id
        }
        itemQuantity
        item @include(if: $showAll) {
          __typename
          relayId
          verificationStatus
          ...ItemCell_data
          ...item_url
          ...PortfolioTableItemCellTooltip_item
          ... on AssetType {
            defaultRarityData @include(if: $isRarityExpansionEnabled) {
              rank
              id
            }
            collection {
              ...CollectionLink_collection
              id
            }
            assetContract {
              ...CollectionLink_assetContract
              id
            }
          }
          ... on AssetBundleType {
            bundleCollection: collection {
              ...CollectionLink_collection
              id
            }
          }
          ... on Node {
            __isNode: __typename
            id
          }
        }
        relayId
        eventTimestamp
        eventType
        customEventName
        orderStatus
        ...utilsAssetEventLabel
        creatorFee {
          unit
        }
        devFeePaymentEvent {
          ...EventTimestamp_data
          id
        }
        fromAccount {
          address
          ...AccountLink_data
          id
        }
        perUnitPrice {
          unit
          eth
          usd
        }
        endingPriceType {
          unit
        }
        priceType {
          unit
        }
        payment {
          ...TokenPricePayment
          id
        }
        seller {
          ...AccountLink_data
          id
        }
        sellOrder {
          taker {
            __typename
            id
          }
          id
        }
        toAccount {
          ...AccountLink_data
          id
        }
        winnerAccount {
          ...AccountLink_data
          id
        }
        ...EventTimestamp_data
        id
      }
    }
  }
}

fragment AccountLink_data on AccountType {
  address
  config
  isCompromised
  user {
    publicUsername
    id
  }
  displayName
  ...ProfileImage_data
  ...wallet_accountKey
  ...accounts_url
}

fragment AssetMediaAnimation_asset on AssetType {
  ...AssetMediaImage_asset
  ...AssetMediaContainer_asset
  ...AssetMediaPlaceholderImage_asset
}

fragment AssetMediaAudio_asset on AssetType {
  backgroundColor
  ...AssetMediaImage_asset
}

fragment AssetMediaContainer_asset on AssetType {
  backgroundColor
  ...AssetMediaEditions_asset_2V84VL
  collection {
    ...useIsRarityEnabled_collection
    id
  }
}

fragment AssetMediaContainer_asset_1LaGDz on AssetType {
  backgroundColor
  ...AssetMediaEditions_asset_2V84VL
  defaultRarityData {
    ...RarityIndicator_data
    id
  }
  collection {
    ...useIsRarityEnabled_collection
    id
  }
}

fragment AssetMediaContainer_asset_1bRsaP on AssetType {
  backgroundColor
  ...AssetMediaEditions_asset_2V84VL
  collection {
    ...useIsRarityEnabled_collection
    id
  }
}

fragment AssetMediaEditions_asset_2V84VL on AssetType {
  decimals
}

fragment AssetMediaImage_asset on AssetType {
  backgroundColor
  imageUrl
  collection {
    displayData {
      cardDisplayStyle
    }
    id
  }
}

fragment AssetMediaPlaceholderImage_asset on AssetType {
  collection {
    displayData {
      cardDisplayStyle
    }
    id
  }
}

fragment AssetMediaVideo_asset on AssetType {
  backgroundColor
  ...AssetMediaImage_asset
}

fragment AssetMediaWebgl_asset on AssetType {
  backgroundColor
  ...AssetMediaImage_asset
}

fragment AssetMedia_asset on AssetType {
  animationUrl
  displayImageUrl
  imageUrl
  isDelisted
  ...AssetMediaAnimation_asset
  ...AssetMediaAudio_asset
  ...AssetMediaContainer_asset_1bRsaP
  ...AssetMediaImage_asset
  ...AssetMediaPlaceholderImage_asset
  ...AssetMediaVideo_asset
  ...AssetMediaWebgl_asset
}

fragment AssetMedia_asset_5MxNd on AssetType {
  animationUrl
  displayImageUrl
  imageUrl
  isDelisted
  ...AssetMediaAnimation_asset
  ...AssetMediaAudio_asset
  ...AssetMediaContainer_asset_1LaGDz
  ...AssetMediaImage_asset
  ...AssetMediaPlaceholderImage_asset
  ...AssetMediaVideo_asset
  ...AssetMediaWebgl_asset
}

fragment CollectionCell_collection on CollectionType {
  name
  imageUrl
  isVerified
  ...collection_url
}

fragment CollectionCell_trait on TraitType {
  traitType
  value
}

fragment CollectionLink_assetContract on AssetContractType {
  address
  blockExplorerLink
}

fragment CollectionLink_collection on CollectionType {
  name
  slug
  verificationStatus
  ...collection_url
}

fragment EventTimestamp_data on AssetEventType {
  eventTimestamp
  transaction {
    blockExplorerLink
    id
  }
}

fragment ItemCell_data on ItemType {
  __isItemType: __typename
  __typename
  displayName
  ...item_url
  ...PortfolioTableItemCellTooltip_item
  ... on AssetType {
    ...AssetMedia_asset
  }
  ... on AssetBundleType {
    assetQuantities(first: 30) {
      edges {
        node {
          asset {
            ...AssetMedia_asset
            id
          }
          relayId
          id
        }
      }
    }
  }
}

fragment PortfolioTableItemCellTooltip_item on ItemType {
  __isItemType: __typename
  __typename
  ...AssetMedia_asset_5MxNd
  ...PortfolioTableTraitTable_asset
  ...asset_url
}

fragment PortfolioTableTraitTable_asset on AssetType {
  assetContract {
    address
    chain
    id
  }
  isCurrentlyFungible
  tokenId
  ...asset_url
}

fragment ProfileImage_data on AccountType {
  imageUrl
}

fragment RarityIndicator_data on RarityDataType {
  rank
  rankPercentile
  rankCount
  maxRank
}

fragment TokenPricePayment on PaymentAssetType {
  symbol
}

fragment accounts_url on AccountType {
  address
  user {
    publicUsername
    id
  }
}

fragment asset_url on AssetType {
  assetContract {
    address
    id
  }
  tokenId
  chain {
    identifier
  }
}

fragment bundle_url on AssetBundleType {
  slug
  chain {
    identifier
  }
}

fragment collection_url on CollectionType {
  slug
  isCategory
}

fragment item_url on ItemType {
  __isItemType: __typename
  __typename
  ... on AssetType {
    ...asset_url
  }
  ... on AssetBundleType {
    ...bundle_url
  }
}

fragment useIsRarityEnabled_collection on CollectionType {
  slug
  enabledRarities
}

fragment utilsAssetEventLabel on AssetEventType {
  isMint
  isAirdrop
  eventType
}

fragment wallet_accountKey on AccountType {
  address
}
